import React, { useState, useEffect } from 'react'
import axios from 'axios';
import './App.css'
import Inp from './Components/inp'

function App() {

  const processedInput = (input) => {
    const new_input = []
    setInput(new_input)
  }

  const [data, setData] = useState([{}])

  useEffect(() => {
    fetch("/back").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])

  return (
    <div>
      {(typeof data.back === 'undefined') ? (
        <p>Loading ...</p>
      ) : (
        data.back.map((back, i) => (
          <div>
            <p key={i}>{back}</p>
            <Inp processedInput={processedInput} />
          </div>
        ))
      )}

    </div>
  )
}

export default App
